static char __pyx_k_Ranks_the_data_dealing_with_tie[] = "\n    Ranks the data, dealing with ties appropriately.\n\n    Equal values are assigned a rank that is the average of the ranks that\n    would have been otherwise assigned to all of the values within that set.\n    Ranks begin at 1, not 0.\n\n    Parameters\n    ----------\n    arr : array_like\n        Input array. If `arr` is not an array, a conversion is attempted.\n    axis : {int, None}, optional\n        Axis along which the elements of the array are ranked. The default\n        (axis=None) is to rank the elements of the flattened array.\n\n    Returns\n    -------\n    y : ndarray\n        An array with the same shape as `arr`. The dtype is 'float64'.\n    \n    See also\n    --------\n    bottlechest.nanrankdata: Ranks the data dealing with ties and NaNs.\n    \n    Examples\n    --------\n    >>> bn.rankdata([0, 2, 2, 3])\n    array([ 1. ,  2.5,  2.5,  4. ])\n    >>> bn.rankdata([[0, 2], [2, 3]])\n    array([ 1. ,  2.5,  2.5,  4. ])\n    >>> bn.rankdata([[0, 2], [2, 3]], axis=0)     \n    array([[ 1.,  1.],\n           [ 2.,  2.]])\n    >>> bn.rankdata([[0, 2], [2, 3]], axis=1)\n    array([[ 1.,  2.],\n           [ 1.,  2.]])\n    \n    ";
static char __pyx_k_Return_nanrankdata_function_and[] = "\n    Return nanrankdata function and array that matches `arr` and `axis`.\n    \n    Under the hood Bottleneck uses a separate Cython function for each\n    combination of ndim, dtype, and axis. A lot of the overhead in\n    bn.nanrankdata() is in checking that `axis` is within range, converting\n    `arr` into an array (if it is not already an array), and selecting the\n    function to use to rank the elements.\n\n    You can get rid of the overhead by doing all this before you, for example,\n    enter an inner loop, by using the this function.\n\n    Parameters\n    ----------\n    arr : array_like\n        Input array. If `arr` is not an array, a conversion is attempted.\n    axis : {int, None}\n        Axis along which to rank the elements of the array.\n    \n    Returns\n    -------\n    func : function\n        The nanrankdata function that matches the number of dimensions and\n        dtype of the input array and the axis along which you wish to rank.\n    a : ndarray\n        If the input array `arr` is not a ndarray, then `a` will contain the\n        result of converting `arr` into a ndarray.\n\n    Examples\n    --------\n    Create a numpy array:\n\n    >>> arr = np.array([np.nan, 2, 2, 3])\n    \n    Obtain the function needed to rank the elements of `arr` along axis=0:\n\n    >>> func, a = bn.func.nanrankdata_selector(arr, axis=0)\n    >>> func\n    <function nanrankdata_1d_float64_axis0>\n    \n    Use the returned function and array:\n\n    >>> func(a)\n    array([ nan,  1.5,  1.5,  3. ])\n\n    ";
static char __pyx_k_Return_rankdata_function_and_ar[] = "\n    Return rankdata function and array that matches `arr` and `axis`.\n    \n    Under the hood Bottleneck uses a separate Cython function for each\n    combination of ndim, dtype, and axis. A lot of the overhead in\n    bn.rankdata() is in checking that `axis` is within range, converting `arr`\n    into an array (if it is not already an array), and selecting the function\n    to use to rank the elements.\n\n    You can get rid of the overhead by doing all this before you, for example,\n    enter an inner loop, by using the this function.\n\n    Parameters\n    ----------\n    arr : array_like\n        Input array. If `arr` is not an array, a conversion is attempted.\n    axis : {int, None}\n        Axis along which to rank the elements of the array.\n    \n    Returns\n    -------\n    func : function\n        The rankdata function that matches the number of dimensions and dtype\n        of the input array and the axis along which you wish to rank.\n    a : ndarray\n        If the input array `arr` is not a ndarray, then `a` will contain the\n        result of converting `arr` into a ndarray.\n\n    Examples\n    --------\n    Create a numpy array:\n\n    >>> arr = np.array([0, 2, 2, 3])\n    \n    Obtain the function needed to rank the elements of `arr` along axis=0:\n\n    >>> func, a = bn.func.rankdata_selector(arr, axis=0)\n    >>> func\n    <function rankdata_1d_int64_axis0>\n    \n    Use the returned function and array:\n\n    >>> func(a)\n    array([ 1. ,  2.5,  2.5,  4. ])\n\n    ";
